{{#each inventory}}
	<div class="departure-button-container swiper-slide {{#ifEquals @index ../currentInventoryIndex}}selected{{/ifEquals}}" 
		data-tour-id="{{tourId}}"
		data-inventory-date="{{inventoryDate}}"
		data-inventory-index="{{@index}}"
		data-inventory-time="{{inventoryTime}}">
		<div class="departure-button-container-inner">
			<div class="departure-button">
				<div class="departure-button-time">
					<div>
						<span class="departure-button-text">{{formatTimeHMM12hours inventoryTime}}</span>
						<span class="departure-button-text-secondary">{{formatTimeAMPM inventoryTime}}</span>
					</div>
				</div>
				<div class="departure-button-seats">
					<span class="departure-button-text">
						{{getSeatsLeft inventory.availability inventory.remaining}}
					</span>
				</div>
			</div>
		</div>
	</div>
{{/each}}

