{{#ifEquals originalPriceProfile.type 'PER_PERSON'}}
	{{#each originalPriceProfile.persons}}
		<div class="price-per-person-container" data-type="{{type}}">
			<div class="person-info-category">
				<span class="person-header">{{getPriceProfilePersonTypeName type}}</span><br/>
				<span class="person-info">{{getPriceProfilePersonAgeString ageFrom ageTo}}</span>
			</div>	
			<div class="person-info-price">
				<div>
					<span class="final-price">AED {{getPriceFromProfile ../finalPriceProfile.persons @index}}</span><br/>
					{{#ifFinalPriceSmaller ../finalPriceProfile.persons @index price}}
						<span class="cut-price"><del>AED {{price}}</del></span>
					{{/ifFinalPriceSmaller}}
				</div>
			</div>
			<div class="number-toggler-wrapper">
				<div class="persons-selector number-toggler"></div>
			</div>
		</div>
	{{/each}}
{{/ifEquals}}
{{#ifEquals finalPriceProfile.type 'PER_GROUP'}}
	<div id="pricePerGroupContainer" class="price-per-group-container">
		<div class="person-info-wrapper">
			<div class="person-info-container">
				<span class="person-header">Guests</span><br/>
			</div>
			<div class="number-toggler-wrapper">
				<div class="persons-selector number-toggler"></div>
			</div>
		</div>
		<div class="pricing-info">
			{{#each finalPriceProfile.groups}}
				<div class="pricing-row">
					<div class="pricing-cell pricing-persons-range">
						<span>{{getPriceProfileGroupPersonString ../finalPriceProfile.groups @index}} 
							{{#if people}}guests{{/if}}{{#unless people}}guest{{/unless}}&nbsp;&nbsp;&nbsp;</span>
					</div>
					<div class="pricing-cell pricing-price">
						<span>AED  {{price}} total</span>
					</div>
				</div>
			{{/each}}
		</div>
	</div>

{{/ifEquals}}
